import circle from "./photo/Group 1.svg"
import './App.css';
function App() {
  return (
    <div className="body">
     <header className="header">
       <p className="logo">logo</p>
         <div className="links">
             <a href="#">menu</a>
             <a href="#">creative</a>
             <a href="#">contact</a>
         </div>
     </header>
        <div className="main-page">
            <h1 className="back-page">CREATIVE NEW DESIGN</h1>
            <div className="main-box"></div>
        </div>

    </div>
  );
}

export default App;
